import styled, {css} from 'styled-components'

export const StyledDiv = styled.div`
    height: 100vh; 
    background-image: linear-gradient(to right, #9DD1F1 80%, yellow 50%);
    border-radius: 20% 20% 10% 50%/ 30% 20% 100% 0% ;
`
